const CartItem = ({item}) => {
  return (
    <div>
      <div>
        <img src={item.image}></img>
      </div>
      <div>
        <p>{item.title}</p>
        <p>{item.description}</p>
        <p>{item.price}</p>
      </div>
    </div>
  );
};

export default CartItem;
